		"Connection: close\r\n" .
		"\r\n"
		);
		$response = '';
		while (!feof($fp)) {
			$response .= @fread($fp, 10240);
		}
		@fclose($fp);
		$content = trim((string)strstr($response, "\r\n\r\n"));
		unset($response);
		if (substr($content, - 2) == '?>') { // overwrite only if file could be downloaded completely
